import React, { Component } from 'react';

import logo from './logo.svg';
import heartOn from './heart-on.png';
import heartOff from './heart-off.png';
import starOn from './star-on.png';
import starOff from './star-off.png';
import responseBubble from './response-bubble.png';

import './App.css';


function SamDialogue(props) {
  return <div className="Sam-div">
           <p className="Sam-dialogue">{props.dialogue}</p>
         </div>;
}    

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          {/* <img src={logo} className="App-logo" alt="logo" /> */  }
          <div className="Dialogue-main">
            <div className="Side-bar-container">
              <div className="Side-bar" id="Hearts-bar">
                <img src={heartOn} className="Side-icon" id="Heart-icon" alt="heart icon" />  
                <img src={heartOn} className="Side-icon" id="Heart-icon" alt="heart icon" />  
                <img src={heartOn} className="Side-icon" id="Heart-icon" alt="heart icon" />  
              </div>
              <div className="Side-bar" id="Stars-bar">
                <img src={starOn} className="Side-icon" id="Star-icon" alt="star icon" />  
                <img src={starOn} className="Side-icon" id="Star-icon" alt="star icon" />  
                <img src={starOn} className="Side-icon" id="Star-icon" alt="star icon" />  
              </div>
            </div>
            <div className="Box">
              <div className="Sam-div">
                <p className="Sam-dialogue">Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi.</p>
              </div>
              <div className="User-div">
                <p className="User-dialogue">Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi. Hi! This is sample text. Hello hello hi.</p>
              </div>
              <div className="Sam-div">
                <p className="Sam-dialogue">Hi! </p>
              </div>
              <div className="User-div">
                <p className="User-dialogue">Hi! This is sample text. </p>
              </div>
              const element = <SamDialogue dialogue="Sara" />;
            </div>
          </div>
          <div className="Response-button-row">
            <img src={responseBubble} className="Response-bubble" alt="response bubble" />  
            <div className="Response-text-div">
                <p>Click here<br/>to<br/>respond!</p>
            </div>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
